import React ,{Component}from 'react'
class LogIn extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            Username:''
         }
    }

    user = (e) =>{
        // console.log(e)
        this.setState({Username:e.target.value})
    }

    render() { 
        return ( 
            <div>
                <input value={this.state.Username} placeholder='Username' onChange={e=>this.user(e)} />
            </div>
         );
    }
}

export default LogIn;
